import React from "react";
export default function Royal_car()
{
    return(
        <>
        <section className="bg-dark">
        <div className="container">
        <div className="row">
        <div className="col-md-12">
        <p>WELCOME TO <b>ROYAL CAR</b></p>
        </div>
        </div>
        </div>
        </section>
        </>
    )
}
